No-needle microneedling is something that I find very interesting. I‚Äôm not sold on the efficacy, but the idea that there is a safe, but effective way to get microneedling results at home is fantastic. As an aesthetician, I‚Äôve helped so many people who have tried to do microneedling at home and damaged their skin, caused irreversible scarring, or spread infections such as staph bacteria. 

It can be really dangerous if you‚Äôre not trained properly. The idea that these might be safe alternatives is extraordinarily exciting for me as someone who wants others to have the best products for the best results, without unnecessary damage.

